import React from 'react';
import './GalleryPage.css';

const images = [
  '/Assets/gallery/WhatsApp Image 2025-07-17 at 19.10.16_d635fbe4.jpg',
  '/Assets/gallery/WhatsApp Image 2025-07-17 at 19.10.16_2a8a3e95.jpg',
  '/Assets/gallery/WhatsApp Image 2025-07-17 at 19.10.15_4b5c4444.jpg',
  '/Assets/gallery/WhatsApp Image 2025-07-17 at 19.10.14_a9eb2e79.jpg',
  '/Assets/gallery/WhatsApp Image 2025-07-17 at 19.10.13_29adedfd.jpg',
  '/Assets/gallery/WhatsApp Image 2025-07-17 at 19.10.14_dddb36ed.jpg',
  '/Assets/gallery/WhatsApp Image 2025-07-17 at 19.10.13_e19fd634.jpg',
  '/Assets/gallery/WhatsApp Image 2025-07-17 at 19.10.13_04b8ee94.jpg',
  '/Assets/gallery/WhatsApp Image 2025-07-17 at 19.10.12_a818b144.jpg',
  '/Assets/gallery/WhatsApp Image 2025-07-17 at 19.10.11_cadfd3f2.jpg',
  '/Assets/gallery/WhatsApp Image 2025-07-17 at 19.10.10_5adb52be.jpg',
];

const GalleryPage = () => (
  <div className="gallery-page">
    <h2>Hotel Gallery</h2>
    <div className="gallery-grid">
      {images.map((src, idx) => (
        <img key={idx} src={src} alt={`Gallery ${idx + 1}`} className="gallery-img" />
      ))}
    </div>
  </div>
);

export default GalleryPage;
